import React from 'react';
import { View, StyleSheet } from 'react-native';
import { CustomText } from './CustomText';

export const ListCard = () => {

    return(
        <View style={styles.form}>
                <FlatList 
                    data={shopList}
                    renderItem={({item}) => (
                        <View>
                            <CustomText>
                                {item.title}
                            </CustomText>
                        </View>
                    )}
                />
            </View> 
    );
};
